import Link from 'next/link'
import { useRouter } from 'next/router'


function BusinessPage() {
  const router = useRouter()

  const { businessId } = router.query

  return (
    <ul>
      <li>
      {businessId}
      </li>
      <li>
        <Link href="/about">
          <a>About Us</a>
        </Link>
      </li>
    </ul>
  )
}

export default BusinessPage
